import React from 'react';
import { Link } from 'react-router-dom';
import Logo from '../Images/MIS SERVICES REQUEST (1).png';

const mystyle = {
	color: 'tomato',
	fontSize: '25px',
	fontFamily: 'serif',
};

const Header = () => {
	return (
		<div className='header'>
			<div className='logo'>
				<img src={Logo} alt='logo' />
			</div>
			<div className='menu'>
				<ul className='navbar-nav me-auto'>
					<li className='nav-item'>
						<Link className='nav-link' to='/' style={mystyle}>
							Home
						</Link>
					</li>
					<li className='nav-item'>
						<Link className='nav-link' to='/menu' style={mystyle}>
							Menu
						</Link>
					</li>
					<li className='nav-item'>
						<Link className='nav-link' to='/about' style={mystyle}>
							About
						</Link>
					</li>
					<li className='nav-item'>
						<Link className='nav-link' to='/contact' style={mystyle}>
							Contact
						</Link>
					</li>
				</ul>
			</div>
		</div>
	);
};
export default Header;
